class wifi_tx(gr.top_block):

    def __init__(self):
        gr.top_block.__init__(self,'wifi_tx')

        ##########################################
        self.digital_gain = 1.0
        self.sample_rate = 5.0e6
        self.bw = 4.1e6
        self.period = 0.300
        self.period_range = [0.006, 1.0]
        self.channels_carrier = [2412e6, 2417e6, 2422e6, 2427e6, 2432e6,
                                 2437e6, 2442e6, 2447e6, 2452e6, 2457e6,
                                 2462e6]
        self.channel = 0
        self.encoding_types = list(range(8))
        self.encoding = 0
        self._pdu_length = 980
        # self.pdu_range = {0:[0, 981]} #-> [0, 981)
        self.pdu_lookup = {
            0:[0, 981],
            1:[0, 1486],
            2:[0, 1501],
            3:[0, 1501],
            4:[0, 1501],
            5:[0, 1501],
            6:[0, 1501],
            7:[0, 1501],
        }
        self.rng = np.random.default_rng()
        self.auto_hop = False

        ##########################################
        self.wifi_phy_hier = wifi_phy_hier(bandwidth=self.sample_rate,
                                           chan_est=ieee802_11.LS,
                                           encoding=ieee802_11.Encoding(self.encoding),
                                           frequency=self.channels_carrier[self.channel],
                                           sensitivity=0.56
                                           )
        self.mac = ieee802_11.mac(self.gen_msg(6),
                                  self.gen_msg(6),
                                  self.gen_msg(6))
        self.gain = blocks.multiply_const_cc(self.digital_gain)
        self.null = blocks.null_source(gr.sizeof_gr_complex)
        self.sink = blocks.vector_sink_c()
        self.wifi_phy_hier.ieee802_11_chunks_to_symbols_xx_0.set_min_noutput_items(1)
        self.wifi_phy_hier.fft_vxx_0_0.set_min_noutput_items(1)
        self.wifi_phy_hier.digital_ofdm_cyclic_prefixer_0_0.set_min_noutput_items(1)
        self.wifi_phy_hier.digital_ofdm_carrier_allocator_cvc_0_0_0.set_min_noutput_items(1)
        self.wifi_phy_hier.digital_chunks_to_symbols_xx_0.set_min_noutput_items(1)
        self.wifi_phy_hier.blocks_tagged_stream_mux_0.set_min_noutput_items(1)
        self.gain.set_min_noutput_items(1)
        self.null.set_min_output_buffer(8192)

        ##########################################
        self.msg_connect((self.mac,'phy out'),(self.wifi_phy_hier,'mac_in'))
        self.connect((self.null,0),(self.wifi_phy_hier,0))
        self.connect((self.wifi_phy_hier,0),(self.gain,0))
        self.connect((self.gain,0),(self.sink,0))

        self.running = False

    @property
    def pdu_length(self):
        return self._pdu_length

    @pdu_length.setter
    def pdu_length(self,l:int):
        if l >= self.pdu_range[1]:
            raise ValueError(f"Value provided exceeds limit of {self.pdu_range[1]}")
        if l < 0:
            raise ValueError(f"Value provided is beneath limit of {self.pdu_range[0]}")
        self._pdu_length = l

    @property
    def pdu_range(self):
        return self.pdu_lookup[self.encoding]

    @pdu_range.setter
    def pdu_range(self,*args,**kwargs):
        raise ValueError("cannot set pdu_range")

    def gen_msg(self,length):
        return np.frombuffer(self.rng.bytes(length),np.uint8).tolist()

    def burst_length(self):
        pdu_len = self.pdu_length
        enc = self.encoding
        dbps = [24,36,48,72,96,144,192,216]
        ofdm_syms = int(round((16+6+8*(pdu_len+28))/dbps[enc]+0.5))+5
        samples = ofdm_syms*80+1
        return samples

    def burst_time(self):
        return self.burst_length()/self.sample_rate

    def step(self):
        if not self.running:
            return list()
        message = self.gen_msg(self.pdu_length)
        pdu = pmt.cons(pmt.PMT_NIL,pmt.init_u8vector(len(message),message))
        self.mac.to_basic_block().post(pmt.intern('app in'),pdu)
        while len(self.sink.data()) < self.burst_length() and self.running:
            time.sleep(0.001)
        data = self.sink.data()
        self.sink.reset()
        # print("wifi:",len(data))
        if self.auto_hop:
            self.hop()
        return data

    def hop(self):
        setattr(self,'frequency',int(self.rng.integers(0,len(self.channels_carrier))))

    @property
    def frequency(self):
        return self.channels_carrier[self.channel]

    @frequency.setter
    def frequency(self,freq:Union[int,float]):
        if isinstance(freq,int):
            if freq >= 0 and freq < len(self.channels_carrier):
                self.channel = freq
            else:
                raise ValueError("The frequency value is not in the range [0,len(channels_carrier))")
        if isinstance(freq,float):
            if freq in self.channels_carrier:
                self.channel = self.channels_carrier.index(freq)
            else:
                raise ValueError("The frequency value is not in the range [0,len(channels_carrier))")

    def set_encoding(self,encoding:int):
        if encoding > 7 or encoding < 0:
            raise ValueError("Invalid encoding value, set between [0, 7]")
        self.encoding = encoding
        self.wifi_phy_hier.set_encoding(encoding)

    def start(self):
        super().start()
        self.running=True
    def stop(self):
        super().stop()
        self.running=0
    def wait(self):
        super().wait()
        self.running = False

    def randomize(self):
        self.frequency = int(self.rng.integers(len(self.channels_carrier)))
        self.set_encoding(int(self.rng.integers(len(self.encoding_types))))
        self.pdu_length = int(self.rng.integers(max(self.pdu_range)))

